script: |
  super -f text -I q7061.spq | sort > q7061.out

inputs:
  - name: q7061.spq
    data: |
      SELECT + col2 - + col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN col0 AND - col0 * 99 + + col0 + - - 77 * + + 95 + + col1 * CAST ( - col0 * + col2 AS REAL );
  - name: tab0

outputs:
  - name: q7061.out
    data: |
